const axios = require("axios")

const apiUrl = 'http://localhost:3000/users'


function Login(){
    function getAllUsers(){
        axios.get(apiUrl)
        .then ((users) =>{
            if (!users) {
                throw new Error('Cannot get users')
            }
            return users
        })
        .catch((e) => console.log(e)) 
        // return 'getAllUsers function call'
    }

    return (
        <div>
            <h1>Login</h1>
            <p>{getAllUsers()}</p>
        </div>
    )
}

export default Login
